Test: Display Types

        /* Reset for consistency */
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { font-family: 'Arial', sans-serif; font-size: 16px; }

        /* Test container */
        .test-container {
            width: 800px;
            height: 900px;
            border: 2px solid #333;
            padding: 20px;
            background-color: #f9f9f9;
        }

        /* Test-specific CSS */
        .display-test {
            margin: 20px 0;
            padding: 15px;
            border: 1px dashed #999;
            background-color: white;
        }

        .test-title {
            font-weight: bold;
            margin-bottom: 10px;
            color: #333;
        }

        .element {
            margin: 5px;
            padding: 10px;
            border: 1px solid #666;
            background-color: #f0f0f0;
        }

        /* Block elements */
        .block {
            display: block;
            background-color: #ffcccc;
        }

        /* Inline elements */
        .inline {
            display: inline;
            background-color: #ccffcc;
        }

        /* Inline-block elements */
        .inline-block {
            display: inline-block;
            width: 120px;
            height: 60px;
            background-color: #ccccff;
            text-align: center;
            line-height: 60px;
        }

        /* None display */
        .none {
            display: none;
            background-color: #ffffcc;
        }

        /* Table display types */
        .table {
            display: table;
            width: 100%;
            background-color: #ffccff;
            border-collapse: separate;
            border-spacing: 2px;
        }

        .table-row {
            display: table-row;
            background-color: #ccffff;
        }

        .table-cell {
            display: table-cell;
            padding: 10px;
            border: 1px solid #666;
            background-color: #ffccaa;
            text-align: center;
        }

        /* List display types */
        .list-item {
            display: list-item;
            margin-left: 20px;
            background-color: #aaffcc;
        }

        /* Flex display (basic) */
        .flex {
            display: flex;
            gap: 10px;
            background-color: #aaccff;
            padding: 10px;
        }

        .flex-item {
            flex: 1;
            padding: 10px;
            border: 1px solid #666;
            background-color: #ffaacc;
            text-align: center;
        }





